import React from "react";
import "./styles/main.css";

function Queue(props) {
  return (
    <aside class="video-list">
      <div class="video-list__item">
        <img class="video-list__thumb" src="" alt="" />
        <h2 class="video-list__title"></h2>
        <span class="video-list__author"></span>
      </div>
    </aside>
  );
}

export default Queue;
